export default function Artwork() {
    const artworkText = ['In addition to my musical activities, I’m very interested in visual art and have been doing a lot of visual artwork myself over the years.', 
    <br />, 'This is a selection of my acrylic paintings created between 2005-2014.', <br />, 'The style is inspired by 60’s OpArt, but my main interest is a musical, “polyphonic” approach, with multiple, simultaneous motives layered on top of each other.',
    <br />, 'Accordingly, I have been very interested in the direct integration between visuals and sound – which was a key motivation for my work with audio-visual digital projects.'];
    return (
        <div className="p-4 text-white bg-slate-700 text-center">
            {/*<h2 className="text-2xl font-bold">Artwork Section</h2>*/}
            <p> {artworkText}  </p>
            <iframe 
                width="420" 
                height="345" 
                src="https://www.youtube.com/embed/Ffe-7T6yDhU" 
                //src={"https://www.youtube.com/embed/Ffe-7T6yDhU"} 
                title="Artwork Video"
                //className="block" 
            ></iframe>
        </div>
    );
}
